    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 IN ( + col2 * - + col1, - 84, - col2, - + col2 + - 48 );
  - name: tab1

outputs:
  - name: q4345.out
    data: |
      51	14	96
      85	5	59
      91	47	68
